import React from 'react'

import TextInput from '../global/forms/inputs/TextInput'
import EmailInput from '../global/forms/inputs/EmailInput'
import PasswordInput from '../global/forms/inputs/PasswordInput'
import CheckBoxInput from '../global/forms/inputs/CheckBoxInput'
import ArcIcon from '../global/forms/icons/ArcIcon'
import RoundedButton from '../global/buttons/RoundedButton'
import Arrow001 from '../global/icons/arrows/Arrow001'

import ValidButton from '../global/forms/buttons/ValidButton'

import './css/CreateAccountForm.scss'

const CreateAccountForm = (props) => {
    return (
        <>
            <div id='signUp-form-CONTAINER'>
                <h4>Sign up</h4>
                <p className='p-medium' style={{ marginLeft: '10px', marginTop: '20px', marginBottom: '20px' }}>Fill in the information below to create your account.</p>
                <form>
                    <div id='signup-form-FIELDS'>
                        <div id='signup-fields-LEFTPANEL'>
                            <TextInput
                                name={'firstname'}
                                label={'First name'}
                                placeholder={'My first name'}
                                className={'textInput_version001 p-medium'}
                            />
                            <EmailInput
                                name={'email'}
                                label={'Email'}
                                placeholder={'My email'}
                                className={'textInput_version001 p-medium'}
                            />
                            <PasswordInput
                                name={'password'}
                                label={'Password'}
                                placeholder={'My password'}
                                className={'textInput_version001 p-medium'}
                                passwordRules_BOOLEAN={true}
                                passwordRules_TEXT={'Must be 8 charachters'}
                                passwordRules_CLASSNAME={'p-small'}
                            />
                        </div>
                        <div id='signup-fields-RIGHTPANEL'>
                            <TextInput
                                name={'lastname'}
                                label={'Last name'}
                                placeholder={'My last name'}
                                className={'textInput_version001 p-medium'}
                            />
                            <EmailInput
                                name={'confirm_email'}
                                label={'Confirm email'}
                                placeholder={'Confirm my email'}
                                className={'textInput_version001 p-medium'}
                            />
                            <PasswordInput
                                name={'confirm_password'}
                                label={'Confirm password'}
                                placeholder={'Confirm my password'}
                                className={'textInput_version001 p-medium'}
                            />
                        </div>
                    </div>
                    <div id='howareyouplanningtouselento-div-CONTAINER'>
                        <h4>How are you planning to use Lento?</h4>
                        <p className='p-medium' style={{ marginTop: '20px', marginBottom: '20px' }}>You can always change your preferences later on.</p>
                        <div id='arc_divs_CONTAINER'>
                            <div className='arc_div_CLASSNAME'>
                                <ArcIcon
                                    width={23}
                                    height={24}
                                    fill={'#eee'}
                                />
                                <div>
                                    <p className='p-medium'>To rent</p>
                                    <div className='p-small'>Aliquam vel orci pulvinar, porta velit in, volutpat neque. Nam vel leo nec nibh tempus congue.</div>
                                </div>
                            </div>
                            <div className='arc_div_CLASSNAME'>
                                <ArcIcon
                                    width={23}
                                    height={24}
                                    fill={'#eee'}
                                />
                                <div>
                                    <p className='p-medium'>To rent out</p>
                                    <div className='p-small'>Aliquam vel orci pulvinar, porta velit in, volutpat neque. Nam vel leo nec nibh tempus congue.</div>
                                </div>
                            </div>
                            <div className='arc_div_CLASSNAME'>
                                <ArcIcon
                                    width={23}
                                    height={24}
                                    fill={'#eee'}
                                />
                                <div>
                                    <p className='p-medium'>As employer</p>
                                    <div className='p-small'>Aliquam vel orci pulvinar, porta velit in, volutpat neque. Nam vel leo nec nibh tempus congue.</div>
                                </div>
                            </div>
                        </div>
                        <div id='howareyouplanningtouselento_FOOTER'>
                            <div>
                                <Arrow001
                                    className={'ninetyDeg_ROTATE'}
                                />
                            </div>
                            <div>
                                <RoundedButton
                                    button_CLASSNAME={'blue_ROUNDEDBUTTON extra_large_ROUNDEDBUTTON cursor-pointer'}
                                    button_ID={'howareyouplanningtouselento_BUTTON'}
                                    span_text_CLASSNAME={'p-medium white_COLOR'}
                                    button_TEXT={'Next'}
                                    Arrow002={false}
                                    redirect_BOOLEAN={true}
                                />
                            </div>
                        </div>
                    </div>
                    <CheckBoxInput
                        name={'rememberme'}
                        label={'Remember me'}
                        /* checked={true} */
                        className={'checkboxInput_version001 p-medium'}
                    />
                    <CheckBoxInput
                        name={'newsletter'}
                        label={'Newsletter'}
                        /* checked={true} */
                        className={'checkboxInput_version001 p-medium'}
                    />
                    <CheckBoxInput
                        name={'newsletter'}
                        label={'I agree to all Terms and conditions'}
                        /* checked={true} */
                        className={'checkboxInput_version001 p-medium'}
                    />
                    <ValidButton
                        validButton_CLASSNAME={'validButton_CLASSNAME cursor-pointer'}
                        validButton_ID={'signup_VALIDBUTTON'}
                        span_text_CLASSNAME={'p-medium white_COLOR'}
                        validButton_TEXT={'Sign up'}
                        redirect_BOOLEAN={true}
                    />
                </form>
            </div>
        </>
    )
}

export default CreateAccountForm
